function lerpV(v1,v2,t) {
    return createVector(lerp(v1.x,v2.x,t),lerp(v1.y,v2.y,t));
}

var xx,yy,vxx,vyy,cx1,cy1,cx2,cy2;

function car(g_,x_,y_,a_) {
    this.pos = createVector(x_,y_);
    
    this.game = g_;
    init_w();
    getw4();
    
    this.speed = createVector(random(-25,25),random(-25,25));
    
    this.angle = a_;
    
    this.chosenThrust;
    this.chosenAngle;
    
    this.show = function () {
        var c = color(255,0,0);
        fill(c);
        stroke(50);
        ellipse(this.pos.x/scaler,this.pos.y/scaler,2*pod_rad/scaler,2*pod_rad/scaler);
        line(this.pos.x/scaler,this.pos.y/scaler,this.pos.x/scaler+pod_rad*cos(this.angle)/scaler,this.pos.y/scaler+pod_rad*sin(this.angle)/scaler)
        
    }
    
    this.nextcp = function(prev){
        var res = this.game.crossing(lerpV(prev,this.pos,1))
        || this.game.crossing(lerpV(prev,this.pos,0.75))
        || this.game.crossing(lerpV(prev,this.pos,0.5))
        || this.game.crossing(lerpV(prev,this.pos,0.25));
        return res;
    }
    
    this.gatherChoice = function() {
        xx = this.pos.x;
        yy = this.pos.y;
        vxx = this.speed.x;
        vyy = this.speed.y;
        cx1 = this.game.cps[0].pos.x;
        cy1 = this.game.cps[0].pos.y;
        cx2 = this.game.cps[1].pos.x;
        cy2 = this.game.cps[1].pos.y;
        anglee = this.angle;
        
        inp[0]=d1();
        inp[1]=d2();
        inp[2]=vc();
        inp[3]=vs();
        inp[4]=vv();
        inp[5]=ac();
        inp[6]=as();
        inp[7]=cpc();
        inp[8]=cps();
        predict();
        //console.log(this.chosenAngle);
        this.chosenAngle = this.angle + PI*max(-18.0,min(18.0,18*resp[0]))/180;
        this.chosenThrust = max(10.0,min(200.0,200*resp[1]));
    }
    
    this.move = function() {
        //console.log('a');
        var prev=createVector(this.pos.x,this.pos.y);
        //console.log('b');
        this.speed.add(createVector(this.chosenThrust*cos(this.chosenAngle),this.chosenThrust*sin(this.chosenAngle)));
        //console.log('c');
        this.pos.add(this.speed);
        //console.log('d');
        this.speed.mult(slow_down_coeff);
        //console.log('e');
        if(this.nextcp(prev)){
            this.game.evolve();
            console.log('ok');
        }
        //console.log('f');
    }
}

/// MATHS
function scal(a1,a2,b1,b2){
    return a1*b1 + a2*b2;}
function vect(a1,a2,b1,b2){
    return a1*b2 - a2*b1;}
function norm2(x1,x2){
    return Math.sqrt(scal(x1,x2,x1,x2));}
function lecos(a1,a2,b1,b2){
    return 1.0*scal(a1,a2,b1,b2)/(norm2(a1,a2)*norm2(b1,b2));}
function lesin(a1,a2,b1,b2){
    return 1.0*vect(a1,a2,b1,b2)/(norm2(a1,a2)*norm2(b1,b2));}



function d1(){
    return 1.0*min(4000,norm2(cx1-xx, cy1-yy))/17500;
}

function d2(){
    return 1.0*norm2(cx1-cx2, cy1-cy2)/8000;
}

function vc(){
    var res = 1.0*Math.atan2(vyy,vxx);
    var rangl = 1.0*Math.atan2(cy1-yy,cx1-xx);
    return Math.cos(res-rangl);
}
function vs(){
    var res = 1.0*Math.atan2(vyy,vxx);
    var rangl = 1.0*Math.atan2(cy1-yy,cx1-xx);
    return Math.sin(res-rangl);
}
function vv(){
    return 1.0*norm2(vyy,vxx)/700;
}
function ac(){
    var res = 1.0*Math.atan2(cy1-yy,cx1-xx);
    var rangl = anglee;
    return Math.cos(res-rangl);
}
function as(){
    var res = 1.0*Math.atan2(cy1-yy,cx1-xx);
    var rangl = anglee;
    return Math.sin(res-rangl);
}
function cpc(){
    return lecos(cx2-cx1,cy2-cy1,xx-cx1,yy-cy1);
}
function cps(){
    return lesin(cx2-cx1,cy2-cy1,xx-cx1,yy-cy1);
}

